import './components.css';

function NavBarButton({ name }) {
    return (
        <div>
            {name}
        </div>
    );
}

export default function NavBar() {
    return (
        <div className="navBar">
            <NavBarButton name={'Home'} />
            <NavBarButton name={'Work'} />
            <NavBarButton name={'Skills'} />
            <NavBarButton name={'Projects'} />
        </div>
    );
}
